import React from 'react';
import './User.css';
import {Navbar, Container, Nav} from 'react-bootstrap';

function User() {
    return (
        <div>
            <Navbar bg="dark" variant="dark" fixed="sticky">
                <Container>
                    <Navbar.Brand href="#home" className="navbarbrand"></Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav className="me-auto navitems">
                        <Nav.Link href="#features">Key Request</Nav.Link>
                        <Nav.Link href="#pricing">Key Download</Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Container>
            </Navbar> 
        </div>
    )
}

export default User
